def my_func(input1: str) -> bool:
    # Helper function to evaluate a simple 'a op b' expression
    def evaluate(a: bool, op: str, b: bool) -> bool:
        if op == '&':
            return a and b
        elif op == '|':
            return a or b
        else:
            raise ValueError(f"Unknown operator: {op}")

    # Convert the input string to a list of tokens
    tokens = []
    for char in input1:
        if char == 't':
            tokens.append(True)
        elif char == 'f':
            tokens.append(False)
        elif char in ('|', '&'):
            tokens.append(char)

    # Stack for values and operators
    values = []
    operators = []

    def apply_operator():
        if len(values) < 2 or not operators:
            raise ValueError("Invalid expression")
        b = values.pop()
        a = values.pop()
        op = operators.pop()
        values.append(evaluate(a, op, b))

    # Go through tokens and evaluate the expression
    i = 0
    while i < len(tokens):
        token = tokens[i]
        if isinstance(token, bool):
            values.append(token)
        elif token in ('|', '&'):
            while (operators and operators[-1] == '&' and token == '|'):
                # Apply all AND operations before applying OR
                apply_operator()
            operators.append(token)
        i += 1

    # Apply remaining operators
    while operators:
        apply_operator()

    return values[0]

# Example usage
print(my_func("f|t&f&f|f&f|f&f&t|t"))  # Output: True

def my_func(input1: str) -> bool:
    # Split the expression based on the '|' operator
    or_sections = input1.split('|')

    # Evaluate each section split by '&'
    def evaluate_and_section(section):
        # Split the section by '&' and check if all are true
        return all(char == 't' for char in section.split('&'))

    # Evaluate the OR logic
    return any(evaluate_and_section(section) for section in or_sections)

# Example usage:
print(my_func("f|t&f&f|f&f|f&f&t|t"))  # Expected output: True
